import client from './client';

const imageFields = ` 
	'image': image.image.asset->{url},
	caption,
    bildetekst,
	'alt': image.alt,
	_key,
    'raw': image,  
`;

export const getImage = async () => {
  const imageData = await client.fetch(`*[_type == "bilder"]{${imageFields}}`);
  return imageData;
};
